INSERT INTO public.genre
  (id, name, region, description)
VALUES
('Blues', 'Blues', NULL, '12-bar structures, shuffle rhythms, and raw emotional expression (Muddy Waters, B.B. King).'),
('Country', 'Country', NULL, 'Storytelling lyrics, acoustic textures, and twang (Johnny Cash, Hank Williams).'),
('Folk', 'Folk', NULL, 'Acoustic, lyric-first songs, typically solo or duo artists (Bob Dylan, Simon & Garfunkel).'),
('Hip Hop', 'Hip Hop', NULL, 'Rhythmic delivery, beat-driven production, and sampling (Dr. Dre, OutKast).'),
('Indie', 'Indie', NULL, 'Alternative rock and pop outside the mainstream polished sound (The Smiths, Arcade Fire).'),
('Jazz', 'Jazz', NULL, 'Swing rhythms, complex harmonies, and improvisation (Miles Davis, Louis Armstrong).'),
('Pop', 'Pop', NULL, 'Polished production, catchy hooks, and radio hits (Michael Jackson, Madonna, ABBA).'),
('R&B/Soul', 'R&B/Soul', NULL, 'Groove-based music rooted in gospel, funk, and Motown (Aretha Franklin, Ray Charles).'),
('Reggae', 'Reggae', NULL, 'Jamaican origin, characterized by the offbeat ''skank'' rhythm (Bob Marley).'),
('Rock', 'Rock', NULL, 'Electric guitars, drums, and attitude; the broad umbrella for Metal, Punk, and Classic Rock.')
